import React, { useState } from 'react';
import Container from './components/Container/Container';
import IntroPage from './components/gameScreen/introPage/IntroPage';
import TestPage from './components/gameScreen/mainPage/test';

function App() {
  const [currentScreen, setCurrentScreen] = useState(<IntroPage />);


  return (
    <Container gameScreen={currentScreen} setGameScreen={setCurrentScreen(<TestPage />)} />
  );
}

export default App;
